                <h1>{item.title}</h1>
                <p>Ingredients: {item.ingredients}</p>
                <p>Instructions: {item.instructions}</p>
            </div>
        });
        return (
            <div>
                {recipe}
            </div>
        )
    }
}

module.exports = Home;

